script: |
  super -f text -I q9102.spq | sort > q9102.out

inputs:
  - name: q9102.spq
    data: |
      SELECT + col0 * + col0 * - - ( - + col2 ) + col0 * - 4 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + CAST ( - - col1 AS REAL ) > - col1;
  - name: tab0

outputs:
  - name: q9102.out
    data: |
